import React from "react";
import styled from "styled-components";
import ImgSlider from "../../mainslider/ImgSlider";

export default function Event() {
  let slidersetting = {
    slidetoshow: 3,
  };
  let data = [
    {
      img: "/Images/bacgroundImg(1).jpg",
      discription: "Description",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(2).jpg",
      discription: "Description",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(3).jpg",
      discription: "Description",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(4).jpg",
      discription: "Description",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(5).jpg",
      discription: "Description",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
  ];
  return (
    <div>
      <ImgDivContainer>
        <ImgSlider data={data} slidersetting={slidersetting} />
        <EventContainer>
          <Event1Container>
            <h2>Lorem, ipsum dolor.</h2>
            <p>
              Lorem ipsum dolor, sit amet consectetur adipisicing elit. Saepe
              fugiat nulla accusantium fugit aspernatur blanditiis quibusdam
              enim ratione deserunt sint magni totam, eveniet, deleniti esse
              veniam voluptatem quaerat dicta eos est aliquam!
            </p>
          </Event1Container>
        </EventContainer>
      </ImgDivContainer>
    </div>
  );
}

const ImgDivContainer = styled.div`
  position: relative;
  top: 60px;
`;

const EventContainer = styled.div`
  border: 2px solid green;
  position: relative;
  top: 50px;
`;

const Event1Container = styled.div`
  border: 2px solid pink;
  margin: 2%;
  border-radius:50%;
  width: 400px;
  height: 400px;
  h2{
    text-align: center;
    
  }
  p{
    text-align: center;
  }
`;
